import React from 'react';
import Carlos from '../Images/imgcarlos.JPG';

function Work() {
  return (
    <div className="mt-[20rem] px-10 ">
      <h1 className="text-center text-2xl font-bold mb-4">Gallery Title</h1>
      <h2 className="text-center text-lg text-gray-600 mb-8">Gallery Subtitle</h2>
      <div className="grid grid-cols-3 gap-4">
        {[...Array(6)].map((_, index) => (
          <div key={index} className="relative aspect-w-1 aspect-h-1 border rounded-lg">
            <h3 className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 text-lg font-bold text-white">Image {index + 1}</h3>
            <img src={Carlos} alt={`Image ${index + 1}`} className="absolute inset-0 object-cover w-full h-full transition-transform transform hover:scale-110" />
          </div>
        ))}
      </div>
    </div>
  );
}

export default Work;
